import Button from 'react-bootstrap/Button'


function SearchBar(){
    return(

        <Form>
        <Row>
          <Col>
            <Form.Control placeholder="Search for An Employee" />

          <><Button variant="outline-dark">Search</Button></>
          </Col>
        </Row>
      </Form>


    )
}

export default SearchBar;
